var initialPlayers = [
    { name: "player0", age: 35, awards: ["AAAAA", "asas"] },
    { name: "player1", age: 30, awards: ["asasa", "asas"] },
    { name: "player2", age: 39, awards: ["troubleshooter", "kingfisher"] },
];

export default initialPlayers;
